import Layout from "../components/Layout";
import Feed from "../components/feed";
import Placard from "../components/placard";
import PostForm from "../components/postForm";

import { makeStyles, Grid } from "@material-ui/core";
import SignIn from "../components/test";

const useStyles = makeStyles({
  sideNav: {
    width: "25%",
    height: "100%",
    position: "fixed",
    //zIndex: 1,
    //left: 0,
    backgroundColor: "#eee",
    paddingTop: 60,
    overflowY: "auto",
  },

  feed: {
    paddingTop: 80,
    marginLeft: 2,
    marginRight: 2,
  },
});

const Index = () => {
  const classes = useStyles();

  return <SignIn />;

  return (
    <Layout>
      <Grid container>
        <Grid item lg={1}></Grid>

        <Grid item lg={3}>
          <div className={classes.sideNav}>
            <Placard title="Talk with an expert" />
          </div>
        </Grid>

        <Grid item lg={4} style={{ backgroundColor: "#eee" }}>
          <div className={classes.feed}>
            <PostForm />

            <Feed />
          </div>
        </Grid>

        <Grid item lg={3}>
          <div className={classes.sideNav}>
            <Placard title="Did you know?" />
            <Placard title="FAQ" />
            <Placard title="Know the Law" />
          </div>
        </Grid>

        <Grid item lg={1}></Grid>
      </Grid>
    </Layout>
  );
};

export default Index;
